  render(){
    return(
      <div className={styles.wrapper}>
      <Title>Add new twitter account</Title>
      <form autoComplete="off" className={styles.form} onSubmit={submitFn}>
        <Input
          name="name"
          label="Name"
          maxLength={30}
        />
        <Input
          name="link"
          label="Twitter link"
        />
        <Input
          name="image"
          label="Image"
        />
        <Input
          tag="textarea"
          name="description"
          label="Description"
        />
        <Button>add new item</Button>
      </form>
    </div>
    );
  }

} 


export default Form;
